import React from 'react';
import {Show, SimpleShowLayout, TextField, NumberField, RichTextField} from 'react-admin';

const OrderShow = (props) => {
    return (
        <Show {...props}>
            <SimpleShowLayout>
                <RichTextField source='_id' />
                <TextField source='product.title' />
                <NumberField source='quantity' />
            </SimpleShowLayout>
        </Show>
    )
};

export default OrderShow;
